import { createAsyncThunk } from "@reduxjs/toolkit";

const fetchCats = createAsyncThunk("cats/fetchCats", async () => {
  const response = await client.get(
    "https://api.thecatapi.com/v1/images/search"
  );
  return response;
});

export default fetchCats;
